import React from 'react';

import { Container, CardsContainer } from './styles';
import Title from '../../Components/Title';
import ContactCard from '../../Components/ContactCard';

const Contact = () => {
  return (
    <Container>
      <Title>Entre em contato</Title>
      <CardsContainer>
        <ContactCard text="victorcostadev@gmail.com" icon="FaEnvelope" />
        <ContactCard text="linkedin.com/in/victorcosta12" icon="FaLinkedinIn" />
        <ContactCard text="instagram.com/victorcosta12" icon="FaInstagram" />
      </CardsContainer>
    </Container>
  );
};

export default Contact;
